
CREATE DATABASE IF NOT EXISTS GMNS;
USE GMNS;

-- Salesperson Master
CREATE TABLE IF NOT EXISTS SalespersonMaster (
    SalespersonID VARCHAR(10) PRIMARY KEY,
    Name VARCHAR(100),
    Region VARCHAR(20),
    HireDate DATE,
    Role VARCHAR(50)
);

-- Transactions
CREATE TABLE IF NOT EXISTS Transactions (
    TxnID VARCHAR(15) PRIMARY KEY,
    Date DATE,
    SalespersonID VARCHAR(10),
    MerchantID VARCHAR(10),
    Revenue DECIMAL(12,2),
    Product VARCHAR(50),
    Region VARCHAR(20),
    Currency VARCHAR(10),
    FOREIGN KEY (SalespersonID) REFERENCES SalespersonMaster(SalespersonID)
);

-- Quotas & Targets
CREATE TABLE IF NOT EXISTS QuotasTargets (
    SalespersonID VARCHAR(10),
    Region VARCHAR(20),
    MonthlyQuota DECIMAL(12,2),
    AttainmentPct DECIMAL(5,2),
    FOREIGN KEY (SalespersonID) REFERENCES SalespersonMaster(SalespersonID)
);

-- Incentives
CREATE TABLE IF NOT EXISTS Incentives (
    SalespersonID VARCHAR(10),
    Month VARCHAR(10),
    Revenue DECIMAL(12,2),
    AttainmentPct DECIMAL(5,2),
    IncentiveEarned DECIMAL(12,2),
    ComplianceFlag VARCHAR(20),
    FOREIGN KEY (SalespersonID) REFERENCES SalespersonMaster(SalespersonID)
);
